import Link from 'next/link';
import { css, jsx } from "@emotion/core";
import styled from "@emotion/styled"

const Container = styled.div`
  display: block;
  top: 0px
  position: fixed;
  padding: 15px 10px;
  margin: 0px;  
  background-color: gray;

  a{
    margin: 15px;
  }
`;//

const MemberWrapper = styled.div`
  display: block;
  float: right;
  border: solid;
`;

const MenuWrapper = styled.div`
  display: block;
  



  border: solid;
`;//float: left;


const Header = () => (
  <Container>
    <MemberWrapper>
      <Link href="/">
      <a className='membership'>로그인</a>
      </Link>
      <Link href="/">
        <a className='membership'>회원가입</a>
      </Link>
    </MemberWrapper>


    <MenuWrapper>
      <Link href="/">
        <a className='menu' id='logo'>로고 OR 웹사이트명</a>
      </Link>

      <Link href="/">
        <a className='menu'>사이트 소개</a>
      </Link>
      <Link href="/">
        <a className='menu'>나의 사이트</a>
      </Link>
      <a id='rank'>1. 더블슬래시</a>
      <a id='button'>ㅁ</a>
    </MenuWrapper>
  </Container>
);

export default Header;
